test("WordPress.newTerm",function(){
	term = wp.newTerm(1, {name: '技术文章', taxonomy: 'category', slug:'technical-articles', description: '此分类下的文章属于技术相关的文章'});
	term_id = term.valueOf();
	equal(true, term_id >= 0, "Term " + term_id + "is created.");

	object = wp.editTerm(1, term_id,{name: '技术文章', taxonomy: 'category', slug:'technical-articles', description: '此分类下的文章属于技术相关的文章'});
	equal(true, object, "Term " + term_id + " is edited");

	object = wp.deleteTerm(1, 'category', term_id);
	equal(true, object, "Term " + term_id + " is deleted");

});
