test("WordPress.newComment",function(){
	// Test newComment and deleteComment
	comment_id = wp.newComment(1, 1, {content: 'This is a new comment from xmlrpc mimic javascript client'});
	equal(typeof comment_id, "object", "Result is OK");
	result = wp.deleteComment(1, comment_id);
	equal(true, result, "Comment id " + comment_id +" deleted");
});
test("WordPress.editComment",function(){
	comment_id = wp.newComment(1, 1, {content: 'This is a new comment from xmlrpc mimic javascript client'});
	object = wp.editComment(1, comment_id, {
		content: 'Modified by he',
		author: "mywordpress",
		author_url: "http://www.wordpress.com/",
		author_email: "user@wordpress.com"
	});
	wp.deleteComment(1, parseInt(comment_id, 10));
	equal(typeof object, "boolean", "Result is OK");
	equal(true, object, "edited");
});
